sources.scss\\login.scss:
* {
    margin: 0;
    padding: 0;
}

li {
    list-style: none;
}

a {
    text-decoration: none;
    color: black;
}

.login_ex {
    position: relative;
    width: 100vw;
    height: 100vh;
    background-color: #EFE8DA;

    .login {
        width: 460px;
        margin: 0 auto;

        h1 {
            text-align: center;
            padding: 30px 0;
        }

        .login_form {
            .title {
                display: inline-block;
                width: 100%;
                margin-bottom: 15px;
            }

            #login_email,
            #login_pw {
                width: 100%;
                height: 30px;
                margin-bottom: 20px;
            }

            input {
                border: none;
                border-bottom: 1px solid black;
                background-color: #EFE8DA;

                &:focus {
                    outline: none;
                }
            }

            #id_save {
                margin-bottom: 30px;
            }

            .basic_login {

                .login_btn,
                .join_btn,
                .non_members_btn {
                    width: 100%;
                    height: 60px;
                    text-align: center;
                    line-height: 60px;
                    background-color: #fff;
                    margin-bottom: 10px;
                    font-size: large;

                    a {
                        display: block;
                    }
                }

                .login_btn {
                    background-color: #9a9a9a;
                }


                .join_btn:hover,
                .non_members_btn:hover {
                    font-weight: bold;
                }
            }

            .find {
                overflow: hidden;
                margin-bottom: 30px;

                .find_id {
                    float: left;
                }

                .find_id:hover {
                    font-weight: bold;
                }

                .find_pw {
                    float: right;
                }

                .find_pw:hover {
                    font-weight: bold;
                }
            }

            .easy_login {
                margin-bottom: 30px;

                .naver_easy,
                .kakao_easy,
                .google_easy {
                    width: 100%;
                    height: 60px;
                    text-align: center;
                    line-height: 60px;
                    background-color: #fff;
                    margin-bottom: 10px;

                    a {
                        display: block;
                    }
                }

                .naver_easy:hover,
                .kakao_easy:hover,
                .google_easy:hover {
                    font-weight: bold;
                }
            }
        }
    }

    .login_info {
        position: absolute;
        left: 50px;
        top: 50px;
        width: 280px;
        height: 230px;
        background-color: white;
        padding: 30px;
        box-sizing: border-box;
    }
}
